import React from "react";
import { TextField } from "@mui/material";

export default function Cadastro(){
    return(
        <div className="w-96 bg-gray-200">
            <div className="bg-cyan-500">
                Cadastrar Usuário
            </div>
            <div className="w-full pt-2">
                <TextField className="" id="outlined-basic" label="Nome" variant="outlined"> </TextField> 
                <TextField id="outlined-basic" label="CPF"variant="outlined"> </TextField> 
                <TextField id="outlined-basic" label="RG" variant="outlined"> </TextField> 
                <TextField id="outlined-basic" label="Nome da Mãe"variant="outlined"> </TextField> 
                <TextField id="outlined-basic" label="Data de Cadastro"variant="outlined"> </TextField> 
                <TextField id="outlined-basic" label="Data de Nascimento" variant="outlined"> </TextField> 
            </div>
        </div>
    )
}
